import axios from 'axios'

function FiveDayForecastTest() {

    const [users, setUsers] = useState([])

useEffect(() => {
axios.get(`https://community-open-weather-map.p.rapidapi.com/forecast?q=vancouver&units=metric`, {
    "method": "GET",
    "headers": {
        "x-rapidapi-key": "e67776521cmshd88d4bf5e0c8e46p16cc0fjsn0bd91cdc12f0",
        "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com"
    }
})
    //response.list.filter(reading => reading.dt_txt.includes("18:00:00"))))
    .then(response => {
        setUsers(response.data.filter(reading => reading.dt_txt.includes("18:00:00")))
    })
    .catch(err => {
        console.log(err.message);
    });
})

    return (
        <div>
                {users.map((user, index) => (
                    <ul>
                     {user.list.map((list, index) =><li>{list}</li>)}
                      <li key={user.list.dt}>{user.list.main}</li>
                      </ul>
                ))}

        </div>
    )
}

export default FiveDayForecastTest
